import React, { Component } from 'react';

class Fun extends Component 
{
    constructor(props){
        super(props);
        this.state={
            data : 'You have the skills'
        }
    }
    getDtata(){
        setTimeout(()=>{
            this.setState({
                data: 'We have the topics '
            })
        }, Infinity)
    }

componentDidMount() {
    this.getDtata();
}

render(){
    return(
        <div>{this.state.data}</div>
    )
}
}

export default Fun;
